import React from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App3.css'
import Header from "./Header"

const App3 = () => {
  return (
    <>
    <Header/>
    <Routes>
      <Route/>
    </Routes>
    </>
  )
}

export default App3;
